//眼灯程序块控制 包括高级程序块
function acoustootic_block_util(block) {
    var blueState = Number(blocklyDatas.getDataByKey('blueState')); //蓝牙状态
    switch (block.type) {
        case 'acoustooptic_lights_color':
        case 'acoustooptic_lights_brightness':
        case 'acoustooptic_lights_on':
        case 'acoustooptic_lights_left_right':
            eyeAllColorDataFresh(block, blueState);
            break;
        case 'acoustooptic_emotions_color_times':
        case 'acoustooptic_scenelight_times':
        case 'acoustooptic_custom_lighting':
            //声光高级块
            acoustooptic_mutiple(block, blueState);
            break;
        case 'group_acoustooptic_emotions_color_times':
        case 'group_acoustooptic_scenelight_times':
        case 'group_acoustooptic_custom_lighting':
            //声光高级块
            acoustooptic_group_block(block, blueState);
            break;
        //自定义音效
        case 'acoustooptic_sound_recording':
            acoustooptic_sound(block);
            break;
    }
}

/**
 * 处理工作空间中block块（更新工作空间block块正确数据）
 * @param block 工作空间块
 */
BlocklyUtils.handleWorkspaceBlock = function (block) {
    console.log(block.type);
    // 如果块有自己的处理逻辑，让块自己处理
    if (block.updateBlock) {
        block.updateBlock();
        return;
    }
    //所有传感器（红外，触碰，陀螺仪）程序块值控制
    sensor_block_util(block);
    //眼灯程序块控制 包括高级程序块
    acoustootic_block_util(block);
    //动作 程序块 控制 包括高级程序块
    motion_block_util(block);
    //超声波 程序块 控制
    ultrasonic_block_util(block);
    //当前模型电池类型 1：锂电池（程序块可用），0：干电池 （程序块不可用）
    isLithium(block);
};
/**
 *   //当前模型电池类型 1：锂电池（程序块可用），0：干电池 （程序块不可用）
 * @param {*} block 
 */
function isLithium(block) {
    if (block.type == "sensor_mainboard_power") {
        var isLithium_temp = Number(blocklyDatas.getDataByKey('isLithium'));
        if (isLithium_temp == 1) {
            block.setDisabled(false);
        } else {
            block.setDisabled(true);
        }
    }
}
/**
 * 复制更改程序块状态
 */
BlocklyUtils.refreshBlock = function () {
    var _that = this;
    var _modelType = parseInt(blocklyDatas.getDataByKey('modelType'));
    if (_modelType == 1) {
        //自建模型  会动态改变ID值，需要先做判断处理
        _that.iterateBlocks(function (block) {
            _that.handleWorkspaceBlock(block);
        });
    }
};

/**
 * 处理工作空间中block块（更新工作空间block块正确数据）
 * @param block 工作空间块
 */
BlocklyUtils.setCustomMathNum = function (block) {
    if (block.parentBlock_ != null) {
        if (block.type == 'custom_math_num') {
            if (block.parentBlock_ && block.parentBlock_.type == 'custom_control_wait_seconds') {
                var oldDuration = block.getFieldValue('NUM');
                oldDuration = parseInt(oldDuration, 10);
                if (isNaN(oldDuration)) {
                    oldDuration = 500;
                }
                var newDuration = 0;
                //处理老数据将时间的单位修改成毫秒
                if (oldDuration <= 500) {
                    //newDuration = oldDuration*1000;  当前值小于500时，全部按照最小值500来取值
                    newDuration = 500;
                } else {
                    newDuration = oldDuration;
                }
                var temp = block.getField("NUM");
                console.log("temp:" + temp);
                console.log("temp typeof:" + (typeof temp === 'undefined' ? 'undefined' : _typeof(temp)));
                if (typeof temp != null) {
                    block.setFieldValue(newDuration, 'NUM');
                }
            }
        }
    }
};

/**
 * 功能： 比较 工作空间的xml与刚进入blockly时的xml 结构内容
 *       判断工作空间的xml是否有变化
 * 返回值;  true 无变化，false 有变化
 */
BlocklyUtils.isWorkspaceXmlChange = function () {
    var isXmlChange = false; //默认无变化
    var current_editobj = Blockly.Xml.domToText(Blockly.Xml.workspaceToDom(Blockly.getMainWorkspace())); //当前编辑程序块什生成的 xml内容
    var defaultXml = blocklyDatas.getDataByKey('defaultXml'); //默认的只有开始的程序块时
    var loadProgramXml = dataService.curXmlObj.xmlContent; //载入的程序块时
    // var compare_tempobj = loadProgramXml;
    // //转换后的xml
    // //Blockly.Xml.textToDom(loadProgramXml)
    // var workspace = Blockly.getMainWorkspace();
    // loadProgramXml = Blockly.Xml.domToText(Blockly.Xml.workspaceToDom(Blockly.Xml.domToWorkspace(Blockly.Xml.textToDom(loadProgramXml),workspace)));
    var compare_tempobj = dataService.curXmlObj.xmlId == "" ? defaultXml : loadProgramXml; //等待被比较的对象
    if (current_editobj) {
        console.log("current_editobj----->", current_editobj);
        console.log("compare_tempobj----->", compare_tempobj);
        var compareResult = ubtUtils.xmlComparison(compare_tempobj, current_editobj);
        isXmlChange = !compareResult;
        console.log("程序块比对结果----------------->", compareResult);
    }
    return isXmlChange;
};

/* ------------------连接蓝牙后，刷新业务块声光 begin-------------------------------- */
// 声光  1,眼灯[全部]+颜色   2,眼灯[全部]+颜色+RGB 数据刷新
function eyeAllColorDataFresh(block, blueState) {
    var lightsArr = blocklyDatas.getLightsIds();
    if (block.type == "acoustooptic_lights_on") {
        var ultrasonicArr = blocklyDatas.getUltrasonicIds();
    }
    if ((lightsArr.length > 0 && lightsArr[0] != "ID" || ultrasonicArr != undefined && ultrasonicArr.length > 0 && ultrasonicArr[0] != "ID") && blueState) {
        if (block.type == "acoustooptic_lights_color" || block.type == "acoustooptic_lights_brightness") {
            var lightsID_Field = block.getField("lightsID");
            var param = block.getFieldValue("lightsID");
            console.log(param);
            if (param == "id_all" || param == "0") {
                param = lightsArr;
            }
            lightsID_Field.sourceBlock_.updateFieldValue("lightsID", param);
        }
        block.setDisabled(false);
    } else {
        block.setDisabled(true);
    }
}
//声光高级块
function acoustooptic_mutiple(block, blueState) {
    var lightsArr = blocklyDatas.getLightsIds();
    var initData = {};
    var updataArr = [];
    var initDataExtra = block.getField('LIST_SERVOS').getExtra();
    if (!initDataExtra) {
        initDataExtra = JSON.parse(block.getFieldValue("mutiple_hiddenObj"));
    }
    if (initDataExtra.curSelectArr[0] == 'ID') {
        updataArr.push(lightsArr[0] + '');
        initData = {
            'curSelectArr': updataArr,
            'isDelay': false,
            'colors': ['#FF0000'],
            'times': [3]
        };
        if (block.type == 'acoustooptic_custom_lighting') {
            initData.curSelPathIndex = [0];
            initData.curSelColorIndex = [0];
            var defaultColorArr = constants.COLOR_ARRAY;
            initData.colors = [defaultColorArr];
        } else {
            initData.emotions = [0];
        }
    } else {
        initData = initDataExtra;
    }
    if (block.getField('LIST_SERVOS').getExtra()) {
        //存在extra
        block.getField('LIST_SERVOS').setExtra(initData);
    } else {
        block.setFieldValue(JSON.stringify(initData), 'mutiple_hiddenObj');
    }
    // if(block.type == 'acoustooptic_emotions_color_times'){
    //     block.updateList();
    // }
    block.updateList();
    if (lightsArr.length > 0 && lightsArr[0] != "ID" && blueState) {
        block.setDisabled(false);
    } else {
        block.setDisabled(true);
    }
}
/**
 * 新增高级块
 * @param {*} block 当前block
 * @param {*} blueState 蓝牙连接状态
 */
function acoustooptic_group_block(block, blueState) {
    var lightsArr = blocklyDatas.getLightsIds();
    var initData = {};
    var updataArr = [];
    //var initDataExtra = JSON.parse(block.getFieldValue("mutiple_hiddenObj"));
    var initDataExtra = block.blockData;
    if (initDataExtra.curSelectArr[0] == 'ID') {
        updataArr.push(lightsArr[0] + '');
        initData = {
            'curSelectArr': updataArr,
            'isDelay': false,
            'colors': ['#FF0000'],
            'times': [3]
        };
        if (block.type == 'group_acoustooptic_custom_lighting') {
            initData.curSelPathIndex = [0];
            initData.curSelColorIndex = [0];
            var defaultColorArr = constants.COLOR_ARRAY;
            initData.colors = [defaultColorArr];
        } else {
            initData.emotions = [0];
        }
        // block.setFieldValue("SENSOR_ID_ID",initDataExtra.curSelectArr[0]);
        if (initData.curSelectArr[0] != "ID") {
            block.setFieldValue("ID-" + initData.curSelectArr[0], "SENSOR_ID_ID");
            block.inputReName("CUSTOM_MATH_NUM_TIME_ID", "CUSTOM_MATH_NUM_TIME_" + initData.curSelectArr[0]);
        }
    } else {
        initData = initDataExtra;
    }
    //block.setFieldValue(JSON.stringify(initData), 'mutiple_hiddenObj');
    block.blockData = initData;
    if (lightsArr.length > 0 && lightsArr[0] != "ID" && blueState) {
        block.setDisabled(false);
    } else {
        block.setDisabled(true);
    }
}

//自定义音效
function acoustooptic_sound(block) {
    var _disabled = true; //设置块是否可用  默认值为不可用
    if (window.blocklyObj && window.blocklyObj.customSoundList) {
        //获取音效列表
        var customerSound = blocklyDatas.getLocalDataByKey("myVoice");
        //获取当前block的值
        var effect = block.getFieldValue('soundObj');
        var jsonEffect = JSON.parse(effect);
        var key = jsonEffect['key'];
        if (isNaN(key)) {
            return;
        }
        //若当前动作为系统音效，则名字需要国际化
        if (jsonEffect.key == "0000") {
            block.getField('recordingName').setText(MSG['sys_sound_name']);
        }
        //赋值
        var customerSoundArray = [];
        if (customerSound != '') {
            customerSoundArray = customerSound;
        }
        var len = customerSoundArray.length; //音效长度
        //判断当前块是否可用
        if (len != 0) {
            for (var i = 0; i < len; i++) {
                var temp_obj = customerSoundArray[i];
                if (key == temp_obj.key) {
                    _disabled = false;
                    break;
                }
            }
        }
    } else {
        //window 环境设置程序块可用
        _disabled = false;
    }
    block.setDisabled(_disabled);
}

