var eventsListener = __webpack_require__(8);

module.exports = function () {
    /**
     * 重写工作空间拖动事件
     * */
    Blockly.WorkspaceDragger.prototype.drag = function (currentDragDeltaXY) {
        var metrics = this.startDragMetrics_;
        var newXY = goog.math.Coordinate.sum(this.startScrollXY_, currentDragDeltaXY);

        // Bound the new XY based on workspace bounds.
        var x = Math.min(newXY.x, -metrics.contentLeft);
        var y = Math.min(newXY.y, -metrics.contentTop);
        x = Math.max(x, metrics.viewWidth - metrics.contentLeft - metrics.contentWidth);
        y = Math.max(y, metrics.viewHeight - metrics.contentTop - metrics.contentHeight);
        this.updataDragGuidePos(x, y);
        x = -x - metrics.contentLeft;
        y = -y - metrics.contentTop;
        this.updateScroll_(x, y);
        this.updataErrorTipPos(x, y);
    };
    /**
     * 工作空间拖动--> 错误提示跟着调整位置
     * */
    Blockly.WorkspaceDragger.prototype.updataErrorTipPos = function (x, y) {
        var obj = document.querySelector('#course_error_block');
        // 如果错误块存在 做以下事情
        if (obj) {
            // 根据错误块的id 保存错误块的位置信息
            eventsListener.trigger('setErrorBlockPositon', blocklyDatas.getDataByKey('errorBlockId'));
            // 获取错误块的位置信息
            var blockPositon = JSON.parse(blocklyDatas.getDataByKey('errorBlockPos'));
            // 更新错误提示的位置提示信息
            eventsListener.trigger('updataErrorTipPos', blockPositon);
        }
    };
    /**
     * 工作空间拖动--> 拖拽类指引动画跟着调整位置
     * */
    Blockly.WorkspaceDragger.prototype.updataDragGuidePos = function (x, y) {
        console.log(x, y);
        //如果存在动画 那么做一下事情
        var guide = document.querySelector('.hand_drag_box');
        if (guide) {
            guide.style.transform = "translate(" + x + "px," + y + "px)";
        }
    };
};

