                        //创建 <field name="actionObj">{"actionName":"系统动作","actionID":"0000","isDefault":true,"curIndex":0}</field>
                        var actionObj_node_options = { nodeName: "field", nodeAttrArray: [{ attrName: "name", attrValue: "actionObj" }], nodeText: JSON.stringify(mutiple_nodeValue) };
                        block_obj.appendChild(createXmlNode(actionObj_node_options, afterXmlContent));
                        //创建 <field name="myactionName">系统动作</field>
                        var myactionName_node_options = { nodeName: "field", nodeAttrArray: [{ attrName: "name", attrValue: "myactionName" }], nodeText: mutiple_nodeValue.actionName };
                        block_obj.appendChild(createXmlNode(myactionName_node_options, afterXmlContent));
                        //创建嵌套数据程序块
                        var rangeOptions = { valueNodeAttr: "MOTION_CUSTOM_ACTION", shadowNodeAttr: "motion_custom_action_math_num", fieldNode: { attrValue: "TIME", nodeText: times } };
                        block_obj.appendChild(create_num_block(times, afterXmlContent, rangeOptions));
